head.script:
if( parseInt( localStorage.getItem('dark') ) == 1){
    document.documentElement.classList.add("dark");
}
const change = input =>{
    const display = input.closest('.switchBtn').querySelector('.slidebtn');
    const html = document.documentElement;
    const rdy = html.classList.contains('dark');
    if(rdy && !input.checked){
        html.classList.remove("dark");
        display.innerHTML = 'Modo claro';
    }else{
        if(! html.classList.contains('dark')){
            html.classList.add("dark");
            display.innerHTML = 'Modo oscuro';
        }
    }
    localStorage.setItem('dark', input.checked?'1':'0');
}

window.dataLayer = window.dataLayer || [];
  function gtag(){dataLayer.push(arguments);}
  gtag('js', new Date());

  gtag('config', 'UA-237398197-1');

body.script:
let links = document.querySelectorAll('a');
        links.forEach(function(link) {
            if(link.href.includes('acortalink.me') && (!link.hasAttribute('taget') || link.getAttribute('target') != '_blank'))
                link.setAttribute('target', '_blank');
        });

if(window.location.href.includes('castellano=sp')){
    for(let a of document.querySelectorAll("a:not(.notnot)")){
        if(a.href.includes("/pelicula/")){
            var url = new URL(a.href);
            url.searchParams.append('castellano', 'sp');
            a.href = url.toString();
        }
    }
    const sp = document.querySelector(".spcb");
    sp.innerHTML = 'Ir a Cinecalidad Latino';
    sp.href = '/';
    const logo = document.querySelector('*[alt="logo"]').parentElement;
    logo.href = '/espana/';
    logo.style.position = 'relative';
    logo.insertAdjacentHTML('beforeend', `
España`);
}
